INSERT INTO public.coin (id, face_value, pretty_face_value, series_or_theme_name, common_name, obverse, reverse, edge, edge_inscription, year_start, year_end, composition, is_non_circulating, weight_grams, diameter_milimeters, comments, created_at, updated_at, deleted_at, period_id, ruler_id, country_id, currency_id, shape_id, numista_number, is_bullion) VALUES (88, 2.000, '€2', NULL, 'Olympic Games, Paris 2024', 'The design represents Marianne, national figure and icon of French numismatics, running in an "old" way in reference to the Olympic Games of the Ancient Era. Its silhouette blends with the Eiffel Tower, a key element of Parisian heritage, to form a common axis with the Iron Lady. In the background, an athletics track in which the emblem of Paris 2024 is inserted on the left side, is depicted. The year date, the mention RF and the mintmarks are inserted under the arch of the tower. The coin''s outer ring depicts the 12 stars of the European flag.', 'A geographical map of Western Europe spans the outer ring and inner core on the right side of the coin. The inscription 2 EURO is superimposed over the map of Europe, with the numeral “2” located in an open field representing the eastern Atlantic Ocean. 12 stars are located on the right side of the outer ring, with six stars atop the map of Europe and six stars below it; six vertical stripes cut across the inner core of the coin, visually connecting the upper and lower star segments.', 'Reeded', NULL, '2021', NULL, 'Bimetallic: nickel brass clad nickel centre in copper-nickel ring', true, 8.500, 25.750, NULL, '2023-01-14 10:37:04.609661+00', '2023-01-14 10:37:04.609661+00', NULL, 8, NULL, 20, 6, 1, NULL, false);
