INSERT INTO public.coin (id, face_value, pretty_face_value, series_or_theme_name, common_name, obverse, reverse, edge, edge_inscription, year_start, year_end, composition, is_non_circulating, weight_grams, diameter_milimeters, comments, created_at, updated_at, deleted_at, period_id, ruler_id, country_id, currency_id, shape_id, numista_number, is_bullion) VALUES (347, 2.000, '€2', NULL, 'Together with Ukraine', 'In the center of the national side (obverse) of the coin is a stylized sunflower, the petals of which are like silhouettes of people holding hands, hugging, protecting each other, embodying unity, support, and the strength of being together. The sunflower is composed by artistic means as if the rising sun is the hope of a new beginning, the birds are freedom, hope and courage, it is like people rising above the circumstances, never putting up with the imposed will, it is an allusion to people who sacrificed their lives, flying away from their souls. The composition also includes the inscriptions "Lithuania", "Together with Ukraine", year of issue 2023, the logo of the producer UAB "Lietuvos monetų kalyklos", 12 EU stars arranged in a circle.', 'A geographical map of Western Europe spans the outer ring and inner core on the right side of the coin. The inscription 2 EURO is superimposed over the map of Europe, with the numeral “2” located in an open field representing the eastern Atlantic Ocean', 'Reeded', 'LAISVĖ ★ VIENYBĖ ★ GEROVĖ ★', '2023', NULL, 'Bimetallic: nickel brass clad nickel centre in copper-nickel ring (Core: 75% Cu, 20% Zn, 5% Ni Ring: 75% Cu, 25% Ni)', false, 8.500, 25.750, NULL, '2023-05-21 22:37:14.322+00', '2023-05-21 22:37:14.322+00', NULL, NULL, NULL, 22, 6, 1, '356346', false);
