INSERT INTO public.coin (id, face_value, pretty_face_value, series_or_theme_name, common_name, obverse, reverse, edge, edge_inscription, year_start, year_end, composition, is_non_circulating, weight_grams, diameter_milimeters, comments, created_at, updated_at, deleted_at, period_id, ruler_id, country_id, currency_id, shape_id, numista_number, is_bullion) VALUES (371, 0.500, 'Half Dollar', NULL, '250th Anniversary of George Washington''s Birth', 'George Washington on horseback', 'Eastern facade of Washington’s home at Mount Vernon, with a heraldic eagle appearing below', 'Reeded', NULL, '1982', NULL, 'Silver (.900)', false, 12.500, 30.610, 'The 1982 George Washington Commemorative Half Dollar marked the beginning of the modern commemorative coin era. The coin was issued to celebrate the 250th anniversary of the birth of George Washington. The coin was designed by Elizabeth Jones, who was serving as the chief sculptor and engraver of the United States Mint at the time the coin was issued. Coins were struck in 90% silver and represented the first 90% silver coins to be produced by the United States Mint since 1964. Proof and uncirculated versions were issued, with proof coins struck at the San Francisco Mint and the uncirculated coins struck at the Denver Mint. A maximum authorized mintage of 10 million coins was established by law. The coins were initially sold at a discount during a “pre-issue” period before regular prices went into effect. Unlike most subsequent modern commemoratives, the George Washington Half Dollars were produced in anticipation of sales throughout 1982 and 1983, although all coins were dated 1982. When the US Mint finally stopped accepting orders for the coins on December 31, 1985, a quantity of more than one million unsold coins were melted. Nonetheless, the program achieved a profit of more than $36 million, which was deposited into the Treasury General Fund. Due to the high mintage of this issue, the coins remain readily available for present-day collectors. The predominant factor in valuing the coins is the market price of silver, based on the coin’s silver content of 0.36169 troy ounces.', '2023-05-27 16:48:59.64+00', '2023-05-27 16:48:59.64+00', NULL, 14, NULL, 2, 1, 1, '4403', false);
INSERT INTO public.coin (id, face_value, pretty_face_value, series_or_theme_name, common_name, obverse, reverse, edge, edge_inscription, year_start, year_end, composition, is_non_circulating, weight_grams, diameter_milimeters, comments, created_at, updated_at, deleted_at, period_id, ruler_id, country_id, currency_id, shape_id, numista_number, is_bullion) VALUES (214, 5.000, '£5', NULL, 'Charles III  75th Birthday', 'Uncrowned portrait of HM King Charles III left, legend around.', 'The King’s heraldic badge accompanied by the number 75 to mark his milestone birthday, all framed within oak leaves and delphiniums.', 'Reeded', NULL, '2023', NULL, 'Copper-nickel', true, 28.280, 38.610, NULL, '2023-03-30 23:04:22.563+00', '2023-03-30 23:04:22.563+00', NULL, 4, 7, 8, 7, 1, NULL, false);
