INSERT INTO public.coin (id, face_value, pretty_face_value, series_or_theme_name, common_name, obverse, reverse, edge, edge_inscription, year_start, year_end, composition, is_non_circulating, weight_grams, diameter_milimeters, comments, created_at, updated_at, deleted_at, period_id, ruler_id, country_id, currency_id, shape_id, numista_number, is_bullion) VALUES (114, 2.000, '€2', NULL, 'Lithuania definitive 2 Euro', 'The coin features the arms of Lithuania, with the date on the right and the country name below. The coin''s outer ring bears the 12 stars of the European Union.', 'A map, next to the face value, shows the European continent without borders.', 'Milled', 'LAISVE*VIENYBE*GEROVE', '2015', '2023', 'Bimetallic: nickel brass clad nickel centre in copper-nickel ring', true, 8.500, 25.750, NULL, '2023-01-14 10:37:04.609661+00', '2023-01-14 10:37:04.609661+00', NULL, 10, NULL, 22, 6, 1, NULL, false);
INSERT INTO public.coin (id, face_value, pretty_face_value, series_or_theme_name, common_name, obverse, reverse, edge, edge_inscription, year_start, year_end, composition, is_non_circulating, weight_grams, diameter_milimeters, comments, created_at, updated_at, deleted_at, period_id, ruler_id, country_id, currency_id, shape_id, numista_number, is_bullion) VALUES (115, 2.000, '€2', NULL, 'Kneeling to Warsaw', 'In center former German Chancellor Willy Brandt laid a wreath at the memorial for the Warsaw Ghetto Uprising, down left menorah. Text, year, mintmark.', 'Value, map of western Europa, stars', 'Reeded', NULL, '2020', NULL, 'Bimetallic: nickel brass clad nickel centre in copper-nickel ring', true, 8.500, 25.750, NULL, '2023-01-14 10:37:04.609661+00', '2023-01-14 10:37:04.609661+00', NULL, 10, NULL, 1, 6, 1, NULL, false);
INSERT INTO public.coin (id, face_value, pretty_face_value, series_or_theme_name, common_name, obverse, reverse, edge, edge_inscription, year_start, year_end, composition, is_non_circulating, weight_grams, diameter_milimeters, comments, created_at, updated_at, deleted_at, period_id, ruler_id, country_id, currency_id, shape_id, numista_number, is_bullion) VALUES (124, 2.000, '€2', NULL, 'Climate Research', 'Nature''s own air quality meter - beard lichen - is depicted on the obverse side of this commemorative euro-currency coin. The relief is composed of a root-like branching network. The insightful motif can also be interpreted as representing the lungs - reminding us of the importance of air quality and its study. The pictorial theme has been designed by artist duo Tuominen Patel (Terhi Tuominen and Jitan V. Patel).', 'A geographical map of Western Europe spans the outer ring and inner core on the right side of the coin. The inscription 2 EURO is superimposed over the map of Europe, with the numeral “2” located in an open field representing the eastern Atlantic Ocean. 12 stars are located on the right side of the outer ring, with six stars atop the map of Europe and six stars below it; six vertical stripes cut across the inner core of the coin, visually connecting the upper and lower star segments.', '?', 'The edge reads SUOMI FINLAND (the name of the country in Finnish and Swedish, its two official languages) and contains three lion heads', '2022', NULL, 'Bimetallic: nickel brass clad nickel centre in copper-nickel ring (Core: 75% Cu, 20% Zn, 5% Ni Ring: 75% Cu, 25% Ni)', true, 8.500, 25.750, NULL, '2023-01-14 10:37:04.609661+00', '2023-01-14 10:37:04.609661+00', NULL, 13, NULL, 24, 6, 1, NULL, false);
INSERT INTO public.coin (id, face_value, pretty_face_value, series_or_theme_name, common_name, obverse, reverse, edge, edge_inscription, year_start, year_end, composition, is_non_circulating, weight_grams, diameter_milimeters, comments, created_at, updated_at, deleted_at, period_id, ruler_id, country_id, currency_id, shape_id, numista_number, is_bullion) VALUES (268, 1.000, '$1', 'Presidential $1 Coin Program', 'Abraham Lincoln 1 Dollar', 'Abraham Lincoln - 16th President - 1861-1865', 'The Statue of Liberty with the denomination to the left and the country name around the rim', '?', '2010 D *** E PLURIBUS UNUM **********', '2010', NULL, 'Manganese-brass clad copper', false, 8.100, 26.500, NULL, '2023-05-07 20:44:59.291+00', '2023-05-07 20:44:59.291+00', NULL, 14, NULL, 2, 1, 1, '16546', false);
INSERT INTO public.coin (id, face_value, pretty_face_value, series_or_theme_name, common_name, obverse, reverse, edge, edge_inscription, year_start, year_end, composition, is_non_circulating, weight_grams, diameter_milimeters, comments, created_at, updated_at, deleted_at, period_id, ruler_id, country_id, currency_id, shape_id, numista_number, is_bullion) VALUES (269, 1.000, '$1', 'Native American $1 Coin Act', 'Native American Dollar', 'Sacagawea (1788-1812), with child. She was a Shoshone native american. She was a translator and a guide to the Lewis and Clark expedition.', 'Native American woman sowing seeds of the Three Sisters (main agricultural crops of some Native American: squash, maize, and climbing beans). It symbolizes the Indian tribes'' contributions to agriculture.', '?', 'E PLURIBUS UNUM ☆☆☆☆☆☆☆☆☆☆ 2009 P ☆☆☆', '2009', NULL, 'Manganese-brass clad copper', false, 8.100, 26.500, NULL, '2023-05-07 20:57:18.226+00', '2023-05-07 20:57:18.226+00', NULL, 14, NULL, 2, 1, 1, '7282', false);
INSERT INTO public.coin (id, face_value, pretty_face_value, series_or_theme_name, common_name, obverse, reverse, edge, edge_inscription, year_start, year_end, composition, is_non_circulating, weight_grams, diameter_milimeters, comments, created_at, updated_at, deleted_at, period_id, ruler_id, country_id, currency_id, shape_id, numista_number, is_bullion) VALUES (356, 500.000, 'L. 500', NULL, '500 Lire', 'Christopher Columbus''s ships, the Nina, Pinta and Santa Maria sailing to right. Below the value, with mint mark and name of the author (within sea waves).', 'Bust of woman in Renaissance dress, representing Italy, surrounded by 19 shields. From lower left the shields are: Genova, Torino, Aosta, Milano, Trento, Venezia, Trieste, Udine, Bologna, Firenze, Ancona, Perugia, Roma, L''Aquila, Napoli, Bari, Potenza, Catanzaro, Palermo, Cagliari. The last two are hidden behind the bust. Below the name of the engraver.', '?', 'REPVBBLICA ITALIANA ***1960***', '1958', '2001', 'Silver (.835) (Copper .165)', false, 11.000, 29.300, NULL, '2023-05-25 16:58:12.671+00', '2023-05-25 16:58:12.671+00', NULL, 21, NULL, 19, 31, 1, '2716', false);
INSERT INTO public.coin (id, face_value, pretty_face_value, series_or_theme_name, common_name, obverse, reverse, edge, edge_inscription, year_start, year_end, composition, is_non_circulating, weight_grams, diameter_milimeters, comments, created_at, updated_at, deleted_at, period_id, ruler_id, country_id, currency_id, shape_id, numista_number, is_bullion) VALUES (357, 5.000, '5 FR', NULL, 'Herdsman', 'Bust of curly-haired herdsman, facing right, wearing hooded shirt, often mistakenly identified as William Tell.', 'Coat of arms of Switzerland on square shield. Edelweiss (Leontopodium nivale) branch with four flowers to the left. Rusty-leaved alpenrose (Rhododendron ferrugineum) branch with flowers in right field.', '?', 'DOMINUS | PROVIDEBIT', '1931', '1969', 'Silver (.835) (16.5% copper)', false, 15.000, 31.450, NULL, '2023-05-25 17:19:03.258+00', '2023-05-25 17:19:03.258+00', NULL, 22, NULL, 175, 32, 1, '194', false);
INSERT INTO public.coin (id, face_value, pretty_face_value, series_or_theme_name, common_name, obverse, reverse, edge, edge_inscription, year_start, year_end, composition, is_non_circulating, weight_grams, diameter_milimeters, comments, created_at, updated_at, deleted_at, period_id, ruler_id, country_id, currency_id, shape_id, numista_number, is_bullion) VALUES (48, 1.000, '$1', NULL, 'National Parks Commemorative', '100th Anniversary of the National Parks', 'Canadian moose with a mountain in the background', 'Reeded', NULL, '1985', NULL, NULL, true, NULL, NULL, NULL, '2023-01-14 10:37:04.609661+00', '2023-01-14 10:37:04.609661+00', NULL, NULL, 6, 5, 4, 1, NULL, false);
