INSERT INTO public.engraver (id, name, comments, created_at, updated_at) VALUES (1, 'Reinhart Heinsdorff', 'Born on September 22nd, 1923 in Rimsting, Heinsdorff grew up in Munich and died March 26th, 2002 in Friedberg-Ottmaring. He has become well known for designing many coins used in Germany and Europe, along with being a painter and sculptor.', '2023-01-14 10:30:44.175768+00', '2023-01-14 10:30:44.175768+00');
INSERT INTO public.engraver (id, name, comments, created_at, updated_at) VALUES (2, 'Charles E. Barber', 'Barber was the sixth Chief Engraver of the United States Mint from 1879 until his death in 1917. Although Barber''s coins were met with mixed reviews, he had a long and fruitful career in coinage, designing most of the coins used at the mint during his time as Chief Engraver.', '2023-01-14 10:30:44.175768+00', '2023-01-14 10:30:44.175768+00');
INSERT INTO public.engraver (id, name, comments, created_at, updated_at) VALUES (3, 'John Bergdahl', NULL, '2023-01-14 10:30:44.175768+00', '2023-01-14 10:30:44.175768+00');
INSERT INTO public.engraver (id, name, comments, created_at, updated_at) VALUES (4, 'Doris Waschk-Balz', 'Neben der Gestaltung von Sondermünzen sind Entwürfe von Waschk-Balz in Gedenkmünzen geprägt. Als Gedenkmünzen der Bundesrepublik Deutschland wurde 1970 eine Serie von fünf Münzen zum Gedenken an die Olympischen Sommerspiele 1972 in München begonnen. Das Motiv der vierten Münze wurde von Waschk-Balz konzipiert.', '2023-01-14 10:30:44.175768+00', '2023-01-14 10:30:44.175768+00');
INSERT INTO public.engraver (id, name, comments, created_at, updated_at) VALUES (5, 'Gilroy Roberts', 'Roberts was a sculptor, gemstone carver, and the ninth Chief Engraver of the United States Mint between 1948 and 1964. He is notable for having designed the obverse of the Kennedy Half Dollar.', '2023-01-14 10:30:44.175768+00', '2023-01-14 10:30:44.175768+00');
INSERT INTO public.engraver (id, name, comments, created_at, updated_at) VALUES (6, 'Seth Huntington', 'Huntington (February 12, 1930 - November 3, 2021) was an American artist and sculptor. ', '2023-01-14 10:30:44.175768+00', '2023-01-14 10:30:44.175768+00');
INSERT INTO public.engraver (id, name, comments, created_at, updated_at) VALUES (7, 'Frank Gasparro', 'Gasparro was the tenth Chief Engraver of the United States Mint, holding this position from February 23, 1965 to January 16, 1981. Before that, he was Assistant Engraver. He designed both sides of the Susan B.', '2023-01-14 10:30:44.175768+00', '2023-01-14 10:30:44.175768+00');
INSERT INTO public.engraver (id, name, comments, created_at, updated_at) VALUES (8, 'Dennis R. Williams', 'Williams is most famously known for designing the Bicentennial Eisenhower Dollar.', '2023-01-14 10:30:44.175768+00', '2023-01-14 10:30:44.175768+00');
INSERT INTO public.engraver (id, name, comments, created_at, updated_at) VALUES (9, 'John R. Sinnock', 'Sinnock was the eighth Chief Engraver of the United States Mint from 1925 to 1947.', '2023-01-14 10:30:44.175768+00', '2023-01-14 10:30:44.175768+00');
INSERT INTO public.engraver (id, name, comments, created_at, updated_at) VALUES (10, 'Felix Oscar Schlag', 'Felix Oscar Schlag was the designer of the United States five cent coin in use from 1938 to 2004.', '2023-01-14 10:30:44.175768+00', '2023-01-14 10:30:44.175768+00');
INSERT INTO public.engraver (id, name, comments, created_at, updated_at) VALUES (11, 'Victor David Brenner', 'Brenner was a Litvak-American sculptor, engraver, and medalist known primarily as the designer of the United States Lincoln Cent.', '2023-01-14 10:30:44.175768+00', '2023-01-14 10:30:44.175768+00');
INSERT INTO public.engraver (id, name, comments, created_at, updated_at) VALUES (12, 'Helmut Andexlinger', 'Helmut Andexlinger is one of our younger numismatic artists, which in part explains why he uses digital technology throughout the coin-design process while his colleagues do so mainly in its latter stages. Both a former pupil of the Fachschule für Metalldesign in Steyr and a graduate in communication studies from the University of Vienna, in 2011 Helmut beat extremely stiff opposition to win the competition to design the 2 euro coin chosen by the EU to celebrate the tenth anniversary of the euro. His artwork will soon be appearing on tens of millions of 2 euro coins all over the continent.', '2023-01-14 10:30:44.175768+00', '2023-01-14 10:30:44.175768+00');
INSERT INTO public.engraver (id, name, comments, created_at, updated_at) VALUES (13, 'Alina Hoyer', NULL, '2023-01-14 10:30:44.175768+00', '2023-01-14 10:30:44.175768+00');
INSERT INTO public.engraver (id, name, comments, created_at, updated_at) VALUES (14, 'Stefan Klein', NULL, '2023-01-14 10:30:44.175768+00', '2023-01-14 10:30:44.175768+00');
INSERT INTO public.engraver (id, name, comments, created_at, updated_at) VALUES (15, 'Glenna Goodacre', 'Goodacre was an American sculptor, best known for having designed the obverse of the Sacagawea dollar that entered circulation in the US in 2000, and the Vietnam Women''s Memorial in Washington, D.C.', '2023-01-14 10:30:44.175768+00', '2023-01-14 10:30:44.175768+00');
INSERT INTO public.engraver (id, name, comments, created_at, updated_at) VALUES (16, 'Thomas D. Rogers', 'Rogers is a former sculptor-engraver with the United States Mint and designer of several U.S. coins, including the 2000-2008 reverse side of the United States Golden dollar coins, or Sacagawea dollars.', '2023-01-14 10:30:44.175768+00', '2023-01-14 10:30:44.175768+00');
INSERT INTO public.engraver (id, name, comments, created_at, updated_at) VALUES (17, 'Anna Rastl', 'After graduating from high school, Anna Rastl, who hails from the beautiful Salzkammergut lake district of central Austria, studied engraving at the Fachschule für Metalldesign in Steyr. As a new member of the Austrian Mint''s design team, she is currently involved in the design of medals for special occasions.', '2023-01-14 10:30:44.175768+00', '2023-01-14 10:30:44.175768+00');
INSERT INTO public.engraver (id, name, comments, created_at, updated_at) VALUES (18, 'Herbert Wähner', 'Another product of the Fachschule für Metalldesign in his hometown of Steyr, Herbert Waehner is not only a gifted numismatic artist but also talented at creating concepts for inspiring children. The mastermind behind the Austrian Mint''s popular children''s workshops, he is both a tireless researcher of the themes chosen for our coins and an expert at transforming them into artistic creations famous in the numismatic world for their depth of detail.', '2023-01-14 10:30:44.175768+00', '2023-01-14 10:30:44.175768+00');
INSERT INTO public.engraver (id, name, comments, created_at, updated_at) VALUES (19, 'Kathrin Kuntner', NULL, '2023-01-14 10:30:44.175768+00', '2023-01-14 10:30:44.175768+00');
INSERT INTO public.engraver (id, name, comments, created_at, updated_at) VALUES (20, 'Susan Taylor', 'Susan Taylor is a Canadian sculptor who serves as Senior Engraver for the Royal Canadian Mint (RCM). Rewarded by multiple prizes, she is vice-delegate of the International Art Medal Federation and was president of the Medallic Art Society of Canada.', '2023-01-14 10:30:44.175768+00', '2023-01-14 10:30:44.175768+00');
INSERT INTO public.engraver (id, name, comments, created_at, updated_at) VALUES (21, 'Susanna Blunt', 'Susanna Blunt is a Canadian portrait artist who designed the most recent portrait of Queen Elizabeth II on the current Canadian coinage, which began in 2003. She was born in Harbin, China, the daughter of an English banker. Blunt started her studies at the Banff School of Fine Arts as a young teenager.', '2023-01-14 10:30:44.175768+00', '2023-01-14 10:30:44.175768+00');
INSERT INTO public.engraver (id, name, comments, created_at, updated_at) VALUES (22, 'Walter Ott', NULL, '2023-01-14 10:30:44.175768+00', '2023-01-14 10:30:44.175768+00');
INSERT INTO public.engraver (id, name, comments, created_at, updated_at) VALUES (23, 'Jody Clark', 'Clark is a British engraver employed by the Royal Mint, notable for designing the fifth and latest portrait of Queen Elizabeth II to feature on coins of the pound sterling.', '2023-01-14 10:30:44.175768+00', '2023-01-14 10:30:44.175768+00');
INSERT INTO public.engraver (id, name, comments, created_at, updated_at) VALUES (24, 'Philip Nathan', 'Nathan (1941) is a sculptor and coin designer. He trained at Guildford School of Art, 1957-62, where he specialized in carving and terracotta modelling, then at the Royal Academy Schools, where he won the silver medal for sculpture. Worked for the Royal Mint as engraver and designer, between 1965 and 1968. Between 1968 and 1973 he worked at the Franklin Mint.', '2023-01-14 10:30:44.175768+00', '2023-01-14 10:30:44.175768+00');
INSERT INTO public.engraver (id, name, comments, created_at, updated_at) VALUES (25, 'Stefanie Radtke', NULL, '2023-01-14 10:30:44.175768+00', '2023-01-14 10:30:44.175768+00');
INSERT INTO public.engraver (id, name, comments, created_at, updated_at) VALUES (26, 'Patrick Niesel', NULL, '2023-01-14 10:30:44.175768+00', '2023-01-14 10:30:44.175768+00');
INSERT INTO public.engraver (id, name, comments, created_at, updated_at) VALUES (27, 'Peter Lasch', NULL, '2023-01-14 10:30:44.175768+00', '2023-01-14 10:30:44.175768+00');
INSERT INTO public.engraver (id, name, comments, created_at, updated_at) VALUES (28, 'Natalie Tekampe', NULL, '2023-01-14 10:30:44.175768+00', '2023-01-14 10:30:44.175768+00');
INSERT INTO public.engraver (id, name, comments, created_at, updated_at) VALUES (29, 'Terhi Tuominen', NULL, '2023-01-14 10:30:44.175768+00', '2023-01-14 10:30:44.175768+00');
INSERT INTO public.engraver (id, name, comments, created_at, updated_at) VALUES (30, 'Jitan V. Patel', NULL, '2023-01-14 10:30:44.175768+00', '2023-01-14 10:30:44.175768+00');
INSERT INTO public.engraver (id, name, comments, created_at, updated_at) VALUES (31, 'Luc Luycx', 'Luycx is a computer engineer and medallist. He was born in Aalst, Belgium and now lives in Dendermonde. Luycx worked for the Royal Belgian Mint.[4] He designed the euro coins in 1996. His signature on all euro coins is visible as two L letters connected together (LL). On the 2-euro coin, this is visible under the O of the word EURO on the common side.', '2023-01-14 10:30:44.175768+00', '2023-01-14 10:30:44.175768+00');
INSERT INTO public.engraver (id, name, comments, created_at, updated_at) VALUES (33, 'James Barton Longacre', 'He was an American portraitist and engraver, and from 1844 until his death the fourth Chief Engraver of the United States Mint. ', '2023-04-01 15:57:00.655268+00', '2023-04-01 15:57:00.655268+00');
INSERT INTO public.engraver (id, name, comments, created_at, updated_at) VALUES (56, 'eric', NULL, '2023-07-15 18:17:20.885+00', '2023-07-15 18:17:20.885+00');
